import React, { Component } from "react";

class Pagination extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <ul class="pagination">
          <li class="page-item">
            <a class="page-link" href="#">
              1
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              2
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              3
            </a>
          </li>
        </ul>
      </React.Fragment>
    );
  }
}

export default Pagination;
